import { StyleSheet, Text, View } from "react-native";
import BlockCard from "./BlockCard";

const FeaturedNews = () => {
  return <BlockCard style={{ marginVertical: 15 }} />;
};
const styles = StyleSheet.create({ container: {} });

export default FeaturedNews;
